import React from 'react';
import { Scatter } from 'react-chartjs-2';
import { Chart as ChartJS, LinearScale, PointElement, Tooltip, Legend } from 'chart.js';

ChartJS.register(LinearScale, PointElement, Tooltip, Legend);

function ScatterPlot() {
  // Define scatter data with multiple datasets, each having two different points in time
  const scatterData = {
    datasets: [
      {
        label: 'Dataset 1 - Time 1',
        data: [
          { x: 1, y: 2 },
          { x: 2, y: 3 },
          { x: 3, y: 4 },
        ],
        backgroundColor: 'rgba(255, 99, 132, 1)', // Red color
      },
      {
        label: 'Dataset 1 - Time 2',
        data: [
          { x: 1.5, y: 2.5 },
          { x: 2.5, y: 3.5 },
          { x: 3.5, y: 4.5 },
        ],
        backgroundColor: 'rgba(255, 99, 132, 0.5)', // Lighter Red for later time
      },
      {
        label: 'Dataset 2 - Time 1',
        data: [
          { x: 2, y: 1 },
          { x: 3, y: 2 },
          { x: 4, y: 3 },
        ],
        backgroundColor: 'rgba(54, 162, 235, 1)', // Blue color
      },
      {
        label: 'Dataset 2 - Time 2',
        data: [
          { x: 2.5, y: 1.5 },
          { x: 3.5, y: 2.5 },
          { x: 4.5, y: 3.5 },
        ],
        backgroundColor: 'rgba(54, 162, 235, 0.5)', // Lighter Blue for later time
      },
      {
        label: 'Dataset 3 - Time 1',
        data: [
          { x: 1, y: 4 },
          { x: 2, y: 5 },
          { x: 3, y: 6 },
        ],
        backgroundColor: 'rgba(75, 192, 192, 1)', // Green color
      },
      {
        label: 'Dataset 3 - Time 2',
        data: [
          { x: 1.5, y: 4.5 },
          { x: 2.5, y: 5.5 },
          { x: 3.5, y: 6.5 },
        ],
        backgroundColor: 'rgba(75, 192, 192, 0.5)', // Lighter Green for later time
      },
      {
        label: 'Dataset 4 - Time 1',
        data: [
          { x: 3, y: 1 },
          { x: 4, y: 2 },
          { x: 5, y: 3 },
        ],
        backgroundColor: 'rgba(153, 102, 255, 1)', // Purple color
      },
      {
        label: 'Dataset 4 - Time 2',
        data: [
          { x: 3.5, y: 1.5 },
          { x: 4.5, y: 2.5 },
          { x: 5.5, y: 3.5 },
        ],
        backgroundColor: 'rgba(153, 102, 255, 0.5)', // Lighter Purple for later time
      },
    ],
  };

  const options = {
    scales: {
      x: {
        type: 'linear',
        position: 'bottom',
        beginAtZero: true,
      },
      y: {
        beginAtZero: true,
      },
    },
  };

  return (
    <div style={{ width: '600px', margin: '0 auto' }}>
      <h2>Scatter Plot with Multiple Time-Series Datasets</h2>
      <Scatter data={scatterData} options={options} />
    </div>
  );
}

export default ScatterPlot;
